import React,{Component} from 'react';
import Person from './persons'

function NameList(){
	const persons = [
		'Diana',
		'Bruce']
		const list = persons.map((person) => <h1>{person}</h1>)
		return (
			<div>
                 {list}
            </div>
			)
}	
export default NameList
